import Layout from '../components/Layout.js'

export default function Index() {
  return (
    <Layout>
      <h1>Startuppers</h1>
      <h2>Wrong. It's "Startupers" with one "p".</h2>
      <div className='layout'>
        <div className='box-l'>
          <a href='https://www.startupers.com'>
            <img src='/milty3.jpg' alt='Milton Hasselbury' />
          </a>
          <p>Tell them Milton Hasselbury sent you.</p>
        </div>
        <div className='box-r'>
          <p>
            Looking for people who are enthusiastic about the formation,
            creation, and participation in startup business ventures?
          </p>
          <p>
            Go to <a href='https://www.startupers.com'>Startupers.com</a> with
            one "p"!
          </p>
          <p>
            Where you can find the coolest{' '}
            <a href='https://www.startupers.com'>startup jobs</a>.
          </p>
        </div>
      </div>
      <style jsx>
        {`
          p {
            margin: 0 0 20px;
          }
          .box-r {
            padding: 20px 0;
          }
          .box-r {
            font-size: 20px;
            line-height: 26px;
          }
          @media (min-width: 840px) {
            .box-l {
              min-width: 500px;
            }
            .box-r {
              padding: 0 20px;
            }
            .layout {
              display: flex;
            }
          }
        `}
      </style>
    </Layout>
  )
}
